    "decription": "Z wave module for ID Lock 150 and 101",
    "overview": "<p>The ID Lock Z-wave module is a security enabled Z-wave Plus product that is able to use encrypted Z-wave Plus messages in order to communicate to other Z-wave Plus products enabled security.<\/p> <p>The module is proprietary for the ID Lock 150 and also backwards compatible with the ID Lock 101. The ID Lock Z-wave module must be used in conjunction with a Security Enabled Z-wave Controller in order to fully utilize their full capability.<\/p> <p>The ID Lock Z-wave module can be included and operated in any Z-wave network containing certified other Z-wave products regardless of manufacturer. The ID Lock Z-wave module does not support the Basic Set Command Class.<\/p>",
    "inclusion": "<ol><li>Bring the controller as close as possible to the lock unit<\/li> <li>Set the controller to inclusion mode<\/li> <li>Push and hold KEY button on the inside panel on the lock until all keys on the outside light up and a audible signal is given.<\/li> <li>Release the KEY button on the inside panel<\/li> <li>Enter your Master PIN and press *\u00a0<\/li> <li>Click 2 and then *<\/li> <li>Click 5, don't press *<\/li> <li>The LED flashes blue when inclusion is in progress<\/li> <li>The inclusion may take some time as security is required<\/li> <\/ol>",
    "exclusion": "<ol><li>Set the controller to Exclusion mode<\/li> <li>Push and hold KEY button on the inside panel on the lock until all keys on the outside light up and a audible signal is given.<\/li> <li>Release the KEY button on the inside panel<\/li> <li>Enter your Master PIN and press *\u00a0<\/li> <li>Click 2 and then *<\/li> <li>Click 5, don't press *<\/li> <li>The LED flashes blue when exclusion is in progress<\/li> <\/ol>",
