            "label": "Door lock mode",
            "description": "Set if the lock is in away mode and if automatic locking should be enabled",
            "overview": "<p>Auto lock Mode, Manual lock mode, Activate Away Mode, Deactivate Away Mode.<\/p> <p>If value is 0x02 (Enable Away, Manual lock) and the door is unlocked value will be set to 0x00.<\/p> <p>If value is 0x03 (Enable Away, Auto lock) and the door is unlocked value will be set to 0x01.<\/p> <p>\uf06c Default Value: 1 (Disable Away\/Auto Lock Mode)<\/p>",
